import React from "react";
import lavarropas from './lavarropas.png';
import './heladeras.png';

export const ObjectCategorias = (
    { id,
        name,
        icon,
        cantidad,
    }) => {
    return (
        <a href={`http://localhost:8080/categorias/${name}`} class="boton"
            onmouseover="BotonOver('')" onmouseout="BotonOut('')">
            <div class="contenido-boton" id="">
                <div class="div-icon">
                    <img id="icono-electricidad" class="icono-trabajo" src={`${name}`}/>
                </div>
                <div class="div-info">
                    <p class="letras-trabajos">{name}</p>
                    <div class="sub-div-info">
                        <img id="personas-electricidad" class="personas" src=""/>
                            <p>
                                {cantidad}
                            </p>
                    </div>
                </div>
            </div>

        </a>
    )
}
